    card and the transactions were actually declined. They have been deleted in the
    amended report. We would like to assure the FEC that necessary adjustments to
    our internal procedures have been made to ensure these mistakes are not repeated.
    If you have any questions, please feel free to contact me at (608) 831-7877. Sincerely,
